import AdminLayout from "../AdminLayout/AdminLayout"



const MTHome = () =>{
    return(
        <>
            <AdminLayout >
                <div className="jumbotron floid-container row mt-4" style={{height: '550px'}}>
                    <h3 style={{textAlign: 'center'}}>Data States Soon Available</h3>
                </div>
            </AdminLayout>
        </>
    )
}

export default MTHome;
